Thompson Twins - Love on Your Side [promo].VOB



HQ rare promo music video. &quot;Love on Your Side&quot; is a song from the album 
&quot;Quick Step and Side Kick&quot; The band broke into the UK Singles Chart and 
the US Billboard Hot 100 chart at the beginning of 1983 with &quot;Lies&quot; and 
&quot;Love On Your Side&quot;, which became the band's first UK Top 10 single. 

They then released their third album, Quick Step and Side Kick 
(called simply Side Kicks in the US), which peaked at number 2 
in the UK and was later certified platinum there. During 1983, 
the band had the opening spot on The Police concert tour in the US.
